q($,"alW","a_x",function(){return H.c([A.hd("Search for #100DaysOfCode on Twitter :) Also, for other ways to connect, go to the Connect page","How do I connect with the people who are also doing this challenge?"),A.hd("The best way to start would be to follow the FreeCodeCamp\u2019s Front End Curriculum from the very beginning. The further you get during the 100 days, the better.","I am new to coding (or just deciding to learn to code) and can\u2019t build projects yet, what should I do?"),A.hd("Don\u2019t worry. Restore as much info on the previous days, but if you can\u2019t then just continue from where you are right now. If you have been tweeting about your progress every day, put the links to your tweets in the Log for each day. Then, follow the format.","I\u2019ve already started the challenge, and I\u2019m currently on Day 8 [*for example]. How can I start using this repo to track my progress?"),A.hd("Absolutely not. You are allowed to miss one day (then make it up by adding one more day to the end of the 100), but never miss two days in a row. This is a great piece of advice on habit formation that I got from Leo Babauta at zen habits.","I\u2019ve missed a day, does it mean I\u2019ve failed the challenge?"),A.hd("Of course it counts! The rule of thumb is: have you coded for at least an hour before going to sleep that day? If yes, you are on track. The reason for this is that we all have different schedules and different life periods (kids, school, work, and what have you) so don\u2019t hold yourself to some arbitrary time standard. You will not experience what Cinderella experienced once the clock strikes midnight. Don\u2019t worry whether you get a point on GitHub on that particular day. Yes, it\u2019s nice to have them in a streak one by one, but don\u2019t do yourself a disservice by measuring your efforts to a clock.","I come home late, and by the time I am finished with my hour, it\u2019s past midnight, does it count?"),A.hd("Yes you should, and the best way to do that is to fork this repo, and commit to the Log daily. It\u2019s helpful in two major ways: you will be able to look at the progress each day and see how far you\u2019ve already come and it will be easier to find the motivation to continue, and the second one is that after you\u2019ve done your 100 days, you will be able to analyze your experience better and see what worked and what didn\u2019t.","Should I keep a journal?"),A.hd("Definitely. It\u2019s great for accountability and motivation to know that the stuff you\u2019ve worked on is accessible online to anyone who may wish to look at it. It will make you care about the end product more, and will lead to a more impressive result in the end. I suggest you put them on GitHub.","Should I put my projects online?"),A.hd("Streaks are nice and helpful, but as I mentioned above\u200a\u2014\u200adon\u2019t worry about them too much and don\u2019t criticize yourself over missing a day. Instead, make sure you do everything to not let that happen again, and know that worrying and scolding yourself will not give you any results. (Ok, It will give you results, but only negative. I would call them consequences, not results) The best way to get out of that negative emotional state is to sit down and code.","Should I worry about streaks?"),A.hd("The part where you have to sit down and start coding. Don\u2019t postpone that or think about it at all, because you will rationalize yourself out of it. Approach it mechanically: sit down, open your laptop, launch your coding editor, and start typing. After 5 minutes, you will not feel any problems/procrastination/desire to stop.","What is the most difficult part of this challenge?"),A.hd("This challenge is individual, so when you join you start at day 1. Whenever you\u2019ll be posting an update on Twitter or elsewhere, make sure to mention which day you are on and use the hashtag so that people can find and support you!","If everyone started on a certain day, should I join them on the day they are? For example, from Day 12?")],H.N("t<lM*>"))})
